script: |
  super -f text -I q10083.spq | sort > q10083.out

inputs:
  - name: q10083.spq
    data: |
      SELECT col1 * - col0, + ( + col1 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 89 * - col1 * + - ( - + ( - - col1 ) ) + 78 <= ( - 32 );
  - name: tab2

outputs:
  - name: q10083.out
    data: |
      -2346	51
      -4928	77
      -5025	67
